(1, 'Ancona_Pescara', 'jvejcejncedkscjskcdrvrgtbtgnbtgbt\r\nbtrg\r\nbrtgfbrfgbv\r\nfrb\r\ntrfbtrfb\r\ntrfb\r\ntr\r\ntrhbtrbtrrrndenjdejsdjdswkjdwkkwdkwkdwekfkefkekfrkfkrkgrkgjrjnevbvbh', , '2021-07-21 15:58:00', '\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d46256.48781766185!2d13.491182979101564!3d43.56424779999999!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x132d8084e3822f2d%3A0x3ff4d14f21488e41!2sStadio%20del%20Conero!5e0!3m2!1sen!2sit!4v1619618566074!5m2!1sen!2sit\"', 'calcio', 'in macchina: cdcececdecedcdc\r\n\r\nin treno:divjejvefkvjfvjfjvf\r\n\r\nin aereo:dhvjhdvjdjdjvdjvdjvcdj', 25, 500, 0, 0, NULL),
(2, 'Alianz Milano-NBV Verona', 'Il giorno 5-05-2021 si disputerà a Milano la partita di super League di pallavolo tra l\'Alianz Milano e NBV Verona.\r\nNBV Verona potrebbe avvicinarsi all\'Alianz Milano in caso di vittoria per la loro situazione in classifica.', , '2021-05-05 18:00:00', '\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2797.3631068682917!2d9.140047614843647!3d45.48263227910115!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4786c1a0655d4a4b%3A0xba1196451bed81f!2sAllianz%20Cloud!5e0!3m2!1sit!2sit!4v1619628627777!5m2!1sit!2sit\"', 'Pallavolo', 'COME RAGGIUNGERE IL POSTO:\r\nIn macchina, uscire dall\'autostrada A1 e proseguire fino Milano centro dove troverà seguenti segnali per arrivare all\'Alianz Cloud.\r\nIn aereo, atterrare nell\'aereoporto di Milano e proseguire fino alla stazione della metropolitana, prendere la linea verde e scendere sulla seguente fermata : Alianz Cloud.\r\nA piedi, prendere la metropolitana (linea verde) fino alla fermata: Alianz Cloud.', 20, 50000, 0, 0, NULL);
INSERT INTO `eventi` (`id`, `nomeEvento`, `descrizione`, `dati`, `dataOra`, `luogo`, `categoria`, `raggiungere`, `prezzo`, `bigliettiDisponibili`, `bigliettiVenduti`, `IncassoTotale`, `sconto`) VALUES
(3, 'Sassuolo-Atalanta', 'Il giorno 02-05-2021 si terrà la partita tra Sassuolo e Atalanta.\r\nl\'Atalanta proverà a vincere per continuare la striscia positiva di vittorie e per rimanere al 2 posto, ma soprattutto per non far crollare la questione scudetto da parte dell\'Inter con 5 giornate di anticipo.', , '2021-05-02 15:00:00', '\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2835.2096187166467!2d10.647284914808438!3d44.71533327909918!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47801c32dbfe6e5b%3A0xf52ec233179c5eb9!2sMAPEI%20Stadium%20-%20Citt%C3%A0%20del%20Tricolore!5e0!3m2!1sit!2sit!4v1619628318279!5m2!1sit!2sit\"', 'Calcio', 'COME RAGGIUNGERE LO STADIO MAPEI STADIUM:\r\nIn macchina, uscire dall\'autostrada e andare verso il centro di sassuolo dove ci saranno cartelli per il MAPEI stadium.\r\nIn aereo, atterrare nell\'aereoporto più vicino a sassuolo e proseguire fino al MAPEI stadium.\r\nA piedi, proseguire verso il MAPEI stadium.', 40, 60000, 0, 0, NULL);
