(4, 'Trento-Brindisi', 'Dieci casi di positività tra giocatori e staff della Happy Casa Brindisi, gli ultimi emersi dai tamponi eseguiti ieri, 19 aprile, hanno indotto la Asl competente a fermare la squadra che è in lotta per il primo posto in serie A e che di sicuro non potrà giocare domenica prossima in campionato, a Trento, per la penultima giornata di campionato. La giornata si recupererà il 12-05-2021 solamente se almeno la metà delle persone contagiate saranno negativizzate.', , '2021-05-12 18:00:00', '\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2769.503072446205!2d11.120962714869584!3d46.04106297911205!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4782740f806cf469%3A0xd7bfa432c7330100!2sBLM%20Group%20Arena!5e0!3m2!1sit!2sit!4v1619629042533!5m2!1sit!2sit\"', 'Basket', 'COME RAGGIUNGERE IL PALATRENTO:\r\nIn macchina , usciti dall\'autostrada proseguire verso il centro di trento e seguire i cartelli sottostanti.\r\nIn Aereo, atterrare nell\'aereoporto..\r\nA piedi, ...', 30, 30000, 0, 0, NULL);

